import React from 'react'
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';
import JornImage from "../images/jornutzon.jpeg"

const handleDragStart = (e) => e.preventDefault();

const items = [
  <img src={JornImage} onDragStart={handleDragStart} role="presentation" />,
  <img src="https://t1.gstatic.com/licensed-image?q=tbn:ANd9GcQMLTF-wQqnQAolDsTtQfnc-MYVuEdBp-BYeQx3jz0zs06W8A7UdmmZcKYzv5ybA2yKLCDNv9iXlUaDLHY" onDragStart={handleDragStart} role="presentation" />,
  <img src="https://t1.gstatic.com/licensed-image?q=tbn:ANd9GcQMLTF-wQqnQAolDsTtQfnc-MYVuEdBp-BYeQx3jz0zs06W8A7UdmmZcKYzv5ybA2yKLCDNv9iXlUaDLHY" onDragStart={handleDragStart} role="presentation" />,
];

export default function EventSection() {

  return (
    <div className='event-section-container'>
      <div className="event-title-container">
        <h2>Most Popular Events</h2>
        <p>Our key events about the Opera Houses's 50 years of History</p>
      </div>
      <AliceCarousel mouseTracking items={items} />
    </div>
  )
}
